import React from "react";

function Tables(props) {
  const { listData } = props;

  const handleClick = memberInfo => {
    props.onClick(memberInfo);
  };

  return (
    <>
      {listData.map(member => {
        return (
          <span
            onClick={event => {
              handleClick(member);
            }}
            className="table"
          >
            {member.nickName}
          </span>
        );
      })}
    </>
  );
}

export default Tables;
